import React from "react";
import { NavLink } from "react-router-dom";

export const MainHero = (): JSX.Element => {
  return (
    <section className="section-hero">
      <div className="hero">
        <div className="hero-text">
          <h1 className="heading-primary">
            All the latest Movies, Shows and Documentaries
          </h1>
          <p className="hero-description">
            Browse the most trending media online all while sharing your
            favorite Movies, Shows and Documentaries with your friends and
            family online
          </p>
          <div className="action-buttons">
            <NavLink to="/browseMedia">
              <button className="browse_media_button">Browse Media</button>
            </NavLink>
          </div>
        </div>
        <img
          src={require("../../imgs/hero-img.png")}
          alt="Image of Bumblebee"
        />
      </div>
    </section>
  );
};
